import React from "react";
import {Tile }from "../tile/Tile";

export const TileList = ({ contacts }) => {
  return (
    <Tile>
      {
        contacts.map((contact) => <Tile name={contact.name} description={contact.description} />)
      }
    </Tile>
  );
};
